INSERT INTO `servicios` (`id`, `id_categoria`, `nombre`, `descripcion`, `est`) VALUES
(1, 0, 'Análisis de Vulnerabilidades', 'Es el proceso de identificar los sistemas en la red que tiene vulnerabilidades conocidas o identificadas, como exploits, fallas, brechas de seguridad, puntos de entrada de acceso inseguros y los errores de configuración del Sistema.', 1),
(2, 0, 'Incident SIEM', 'Es la recopilacion de registros de dispositivos de red, registros de servidores, registros de aplicaciones y otros, para luego normalizarlos, correlacionarlos y analizarlos en busca de patrones o indicadores de actividad maliciosa o sospechosa', 1),
(3, 2, 'Instalacion EDR', 'Endpoint Detection & Response (EDR), ESET, FC son herramientas para la identificación de infracciones y comportamientos anómalos, evaluación de riesgos, respuesta a incidentes, investigaciones y remediación', 1),
(4, 1, 'Instalación EMS', 'Endpoint Detection & Response (EDR), ESET, FC son herramientas para la identificación de infracciones y comportamientos anómalos, evaluación de riesgos, respuesta a incidentes, investigaciones y remediación', 1),
(5, 0, 'Instalación ESET', 'Endpoint Detection & Response (EDR), ESET, FC son herramientas para la identificación de infracciones y comportamientos anómalos, evaluación de riesgos, respuesta a incidentes, investigaciones y remediación', 1),
(6, 0, 'Reparación de equipos', 'Esta actividad consta en reparar equipos de electrónica como Ordenadores, Notebooks, Monitores,etc', 1),
(7, 0, 'Desarrollo Interno', 'Es la creación e implementación de herramientas y procedimientos internos para un mejor desempeño del área', 1),
(8, 0, 'Boletín Informativo', 'Un boletín informativo es creado y divulgado institucionalmente con el fin de capacitar al personal policial sobre las buenas prácticas en Ciberseguridad', 1),
(9, 0, 'Auditoría', 'Las auditorías se llevan a cabo para verificar el correcto cumplimiento y desempeño del personal policial en materia de Ciberseguridad', 1),
(10, 0, 'Capacitación', 'Las capacitaciones consisten en formar y educar al personal policial sobre la ética y buenas prácticas en materia de seguridad informática', 1),
(11, 0, 'Incidente Response', 'Es un conjunto de acciones planificadas y coordinadas tomadas para abordar y manejar incidentes de seguridad informática, como ataques cibernéticos, brechas de seguridad o violaciones de datos', 1),
(12, 0, 'Incident EDR', 'Es la detección y respuesta a incidentes (Endpoint Detection and Response) centrado en la protección de los puntos finales, como notebooks, desktops y servidores ', 1),
(13, 0, 'Pentest', 'Un pentesting es la técnica de ciberseguridad consistente en atacar entornos informáticos con la intención de descubrir vulnerabilidades en los mismos, con el objetivo de reunir la información necesaria para poder prevenir en el futuro ataques externos', 0),
(14, 0, 'Relevamiento-Informatica', 'Es la recopilacion de informacion sobre Hardware y Software', 1);
